import React, { useState, useEffect } from 'react';
import { AboutContent, defaultAboutContent } from '../data/aboutContent';
import './AboutEditor.css';

const AboutEditor: React.FC = () => {
  const [content, setContent] = useState<AboutContent>(defaultAboutContent);
  const [activeSection, setActiveSection] = useState<string>('hero');
  const [hasChanges, setHasChanges] = useState(false);

  useEffect(() => {
    // Load saved content from localStorage
    const savedContent = localStorage.getItem('about-content');
    if (savedContent) {
      try {
        const parsed = JSON.parse(savedContent);
        setContent({ ...defaultAboutContent, ...parsed });
      } catch (error) {
        console.error('Error loading about content:', error);
      }
    }
  }, []);

  const handleSave = () => {
    localStorage.setItem('about-content', JSON.stringify(content));
    setHasChanges(false);
    alert('About page content saved successfully!');
  };

  const handleReset = () => {
    if (window.confirm('Are you sure you want to reset to default content? This will lose all your changes.')) {
      setContent(defaultAboutContent);
      localStorage.removeItem('about-content');
      setHasChanges(true);
    }
  };

  const updateContent = (field: string, value: string) => {
    setContent(prev => ({ ...prev, [field]: value }));
    setHasChanges(true);
  };

  const updateNestedContent = (section: string, field: string, value: any) => {
    setContent(prev => {
      const sectionData = prev[section as keyof AboutContent];
      // Ensure we're working with an object
      if (typeof sectionData === 'object' && sectionData !== null) {
        return {
          ...prev,
          [section]: { ...sectionData, [field]: value }
        };
      }
      return prev;
    });
    setHasChanges(true);
  };

  const sections = [
    { id: 'hero', name: '🏠 Hero Section', description: 'Main title and subtitle' },
    { id: 'story', name: '📖 Our Story', description: 'Company story and background' },
    { id: 'vermont', name: '🏔️ Vermont Section', description: 'Location and local connection' },
    { id: 'values', name: '⭐ Values', description: 'Company values and principles' },
    { id: 'stats', name: '📊 Statistics', description: 'Company stats and achievements' }
  ];

  const renderHeroEditor = () => (
    <div className="editor-section">
      <h3>Hero Section</h3>
      <div className="form-group">
        <label>Main Title</label>
        <input
          type="text"
          value={content.heroTitle}
          onChange={(e) => updateContent('heroTitle', e.target.value)}
          placeholder="About Sunrise Scents"
        />
      </div>
      <div className="form-group">
        <label>Subtitle</label>
        <textarea
          value={content.heroSubtitle}
          onChange={(e) => updateContent('heroSubtitle', e.target.value)}
          placeholder="Brief description..."
          rows={2}
        />
      </div>
    </div>
  );

  const renderStoryEditor = () => (
    <div className="editor-section">
      <h3>Our Story Section</h3>
      <div className="form-group">
        <label>Section Title</label>
        <input
          type="text"
          value={content.storyTitle}
          onChange={(e) => updateContent('storyTitle', e.target.value)}
          placeholder="Our Story"
        />
      </div>
      <div className="form-group">
        <label>Lead Paragraph (highlighted text)</label>
        <textarea
          value={content.storyLead}
          onChange={(e) => updateContent('storyLead', e.target.value)}
          placeholder="Opening paragraph that stands out..."
          rows={3}
        />
      </div>
      <div className="form-group">
        <label>First Paragraph</label>
        <textarea
          value={content.storyParagraph1}
          onChange={(e) => updateContent('storyParagraph1', e.target.value)}
          placeholder="First story paragraph..."
          rows={4}
        />
      </div>
      <div className="form-group">
        <label>Second Paragraph</label>
        <textarea
          value={content.storyParagraph2}
          onChange={(e) => updateContent('storyParagraph2', e.target.value)}
          placeholder="Second story paragraph..."
          rows={4}
        />
      </div>
      <div className="form-group">
        <label>Third Paragraph</label>
        <textarea
          value={content.storyParagraph3}
          onChange={(e) => updateContent('storyParagraph3', e.target.value)}
          placeholder="Third story paragraph..."
          rows={3}
        />
      </div>
    </div>
  );

  const renderVermontEditor = () => (
    <div className="editor-section">
      <h3>Vermont Section</h3>
      <div className="form-group">
        <label>Section Title</label>
        <input
          type="text"
          value={content.vermontTitle}
          onChange={(e) => updateContent('vermontTitle', e.target.value)}
          placeholder="Made in Vermont"
        />
      </div>
      <div className="form-group">
        <label>First Paragraph</label>
        <textarea
          value={content.vermontParagraph1}
          onChange={(e) => updateContent('vermontParagraph1', e.target.value)}
          placeholder="Describe your Vermont location..."
          rows={4}
        />
      </div>
      <div className="form-group">
        <label>Second Paragraph</label>
        <textarea
          value={content.vermontParagraph2}
          onChange={(e) => updateContent('vermontParagraph2', e.target.value)}
          placeholder="Vermont values and connection..."
          rows={3}
        />
      </div>
      <div className="form-group">
        <label>Company Name</label>
        <input
          type="text"
          value={content.companyName}
          onChange={(e) => updateContent('companyName', e.target.value)}
          placeholder="Sunrise Scents, LLC."
        />
      </div>
      <div className="form-group">
        <label>Business Address</label>
        <textarea
          value={content.address}
          onChange={(e) => updateContent('address', e.target.value)}
          placeholder="PO Box 241..."
          rows={2}
        />
      </div>
    </div>
  );

  const renderValuesEditor = () => (
    <div className="editor-section">
      <h3>Values Section</h3>
      <div className="form-group">
        <label>Section Title</label>
        <input
          type="text"
          value={content.valuesTitle}
          onChange={(e) => updateContent('valuesTitle', e.target.value)}
          placeholder="Our Values"
        />
      </div>
      <div className="form-group">
        <label>Section Subtitle</label>
        <input
          type="text"
          value={content.valuesSubtitle}
          onChange={(e) => updateContent('valuesSubtitle', e.target.value)}
          placeholder="The principles that guide everything we do"
        />
      </div>

      <div className="values-grid">
        <div className="value-editor">
          <h4>Quality First</h4>
          <div className="form-group">
            <label>Title</label>
            <input
              type="text"
              value={content.values.quality.title}
              onChange={(e) => updateNestedContent('values', 'quality', { ...content.values.quality, title: e.target.value })}
            />
          </div>
          <div className="form-group">
            <label>Description</label>
            <textarea
              value={content.values.quality.description}
              onChange={(e) => updateNestedContent('values', 'quality', { ...content.values.quality, description: e.target.value })}
              rows={2}
            />
          </div>
        </div>

        <div className="value-editor">
          <h4>Accessibility</h4>
          <div className="form-group">
            <label>Title</label>
            <input
              type="text"
              value={content.values.accessibility.title}
              onChange={(e) => updateNestedContent('values', 'accessibility', { ...content.values.accessibility, title: e.target.value })}
            />
          </div>
          <div className="form-group">
            <label>Description</label>
            <textarea
              value={content.values.accessibility.description}
              onChange={(e) => updateNestedContent('values', 'accessibility', { ...content.values.accessibility, description: e.target.value })}
              rows={2}
            />
          </div>
        </div>

        <div className="value-editor">
          <h4>Creativity</h4>
          <div className="form-group">
            <label>Title</label>
            <input
              type="text"
              value={content.values.creativity.title}
              onChange={(e) => updateNestedContent('values', 'creativity', { ...content.values.creativity, title: e.target.value })}
            />
          </div>
          <div className="form-group">
            <label>Description</label>
            <textarea
              value={content.values.creativity.description}
              onChange={(e) => updateNestedContent('values', 'creativity', { ...content.values.creativity, description: e.target.value })}
              rows={2}
            />
          </div>
        </div>

        <div className="value-editor">
          <h4>Community</h4>
          <div className="form-group">
            <label>Title</label>
            <input
              type="text"
              value={content.values.community.title}
              onChange={(e) => updateNestedContent('values', 'community', { ...content.values.community, title: e.target.value })}
            />
          </div>
          <div className="form-group">
            <label>Description</label>
            <textarea
              value={content.values.community.description}
              onChange={(e) => updateNestedContent('values', 'community', { ...content.values.community, description: e.target.value })}
              rows={2}
            />
          </div>
        </div>
      </div>
    </div>
  );

  const renderStatsEditor = () => (
    <div className="editor-section">
      <h3>Statistics Section</h3>
      <div className="stats-grid">
        <div className="stat-editor">
          <h4>Fragrances Stat</h4>
          <div className="form-group">
            <label>Number</label>
            <input
              type="text"
              value={content.stats.fragrances.number}
              onChange={(e) => updateNestedContent('stats', 'fragrances', { ...content.stats.fragrances, number: e.target.value })}
              placeholder="50+"
            />
          </div>
          <div className="form-group">
            <label>Label</label>
            <input
              type="text"
              value={content.stats.fragrances.label}
              onChange={(e) => updateNestedContent('stats', 'fragrances', { ...content.stats.fragrances, label: e.target.value })}
              placeholder="Unique Fragrances"
            />
          </div>
        </div>

        <div className="stat-editor">
          <h4>Experience Stat</h4>
          <div className="form-group">
            <label>Number</label>
            <input
              type="text"
              value={content.stats.experience.number}
              onChange={(e) => updateNestedContent('stats', 'experience', { ...content.stats.experience, number: e.target.value })}
              placeholder="15+"
            />
          </div>
          <div className="form-group">
            <label>Label</label>
            <input
              type="text"
              value={content.stats.experience.label}
              onChange={(e) => updateNestedContent('stats', 'experience', { ...content.stats.experience, label: e.target.value })}
              placeholder="Years of Expertise"
            />
          </div>
        </div>

        <div className="stat-editor">
          <h4>Ingredients Stat</h4>
          <div className="form-group">
            <label>Number</label>
            <input
              type="text"
              value={content.stats.ingredients.number}
              onChange={(e) => updateNestedContent('stats', 'ingredients', { ...content.stats.ingredients, number: e.target.value })}
              placeholder="100%"
            />
          </div>
          <div className="form-group">
            <label>Label</label>
            <input
              type="text"
              value={content.stats.ingredients.label}
              onChange={(e) => updateNestedContent('stats', 'ingredients', { ...content.stats.ingredients, label: e.target.value })}
              placeholder="Natural Ingredients"
            />
          </div>
        </div>
      </div>
    </div>
  );

  const renderActiveSection = () => {
    switch (activeSection) {
      case 'hero': return renderHeroEditor();
      case 'story': return renderStoryEditor();
      case 'vermont': return renderVermontEditor();
      case 'values': return renderValuesEditor();
      case 'stats': return renderStatsEditor();
      default: return renderHeroEditor();
    }
  };

  return (
    <div className="about-editor">
      <div className="editor-header">
        <div>
          <h2>About Page Editor</h2>
          <p>Edit your About page content with a simple, user-friendly interface</p>
        </div>
        <div className="editor-actions">
          {hasChanges && <span className="changes-indicator">• Unsaved changes</span>}
          <button className="btn btn-outline" onClick={handleReset}>
            Reset to Default
          </button>
          <button className="btn btn-primary" onClick={handleSave}>
            Save Changes
          </button>
        </div>
      </div>

      <div className="editor-content">
        <div className="sections-nav">
          {sections.map(section => (
            <button
              key={section.id}
              className={`section-btn ${activeSection === section.id ? 'active' : ''}`}
              onClick={() => setActiveSection(section.id)}
            >
              <div className="section-info">
                <h3>{section.name}</h3>
                <p>{section.description}</p>
              </div>
            </button>
          ))}
        </div>

        <div className="editor-form">
          {renderActiveSection()}
        </div>
      </div>
    </div>
  );
};

export default AboutEditor;
